script: |
  super -f text -I q12285.spq | sort > q12285.out

inputs:
  - name: q12285.spq
    data: |
      SELECT + 22 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 BETWEEN NULL AND ( - 69 + - - col2 * - col1 * 63 * 26 );
  - name: tab2

outputs:
  - name: q12285.out
    data: |
      22
      22
      22
